values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"coordinates":null,"data_source":{"id":"1002"},"glyph":{"id":"1031"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1033"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1035"}},"id":"1034","type":"GlyphRenderer"},{"attributes":{"data":{"bandwidth":[917458029.7692087,781704480.3026451,733807965.6152536],"bandwidth_text":["874.96 MiB","745.49 MiB","699.81 MiB"],"destination":["tcp://172.21.1.54:37080","tcp://172.21.1.55:34986","tcp://172.21.1.55:34986"],"source":["tcp://172.21.1.77:34469","tcp://172.21.1.67:33051","tcp://172.21.1.21:32936"]},"selected":{"id":"1507"},"selection_policy":{"id":"1506"}},"id":"1150","type":"ColumnDataSource"},{"attributes":{},"id":"1320","type":"UnionRenderers"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth: 98.77 MiB"},"id":"1153","type":"Title"},{"attributes":{},"id":"1023","type":"ResetTool"},{"attributes":{"coordinates":null,"formatter":{"id":"1318"},"group":null,"major_label_policy":{"id":"1319"},"ticker":{"id":"1293"}},"id":"1292","type":"DatetimeAxis"},{"attributes":{"factors":["tcp://172.21.1.21:32936","tcp://172.21.1.54:37080","tcp://172.21.1.55:34986","tcp://172.21.1.67:33051","tcp://172.21.1.77:34469"]},"id":"1155","type":"FactorRange"},{"attributes":{},"id":"1288","type":"LinearScale"},{"attributes":{"fill_alpha":{"value"
